import static org.junit.jupiter.api.Assertions.*;
import org.springframework.web.bind.WebDataBinder;

@ExtendWith(MockitoExtension.class)
class OwnerControllerTest {

	@Mock
	private OwnerRepository owners;

	@InjectMocks
	private OwnerController controller;

	@BeforeEach
	void setUp() {
		// Mockito initializes @Mock and @InjectMocks automatically
	}

	@Test
	@DisplayName("Sets the allowed fields by disallowing the 'id' field on the WebDataBinder")
	void testSetAllowedFieldsDisallowsId() {
		WebDataBinder dataBinder = new WebDataBinder(new Owner());
		controller.setAllowedFields(dataBinder);
	}

	@Test
	@DisplayName("Verifies that calling setAllowedFields mutates the WebDataBinder to disallow 'id'")
	void testSetAllowedFieldsMutatesDataBinder() {
		// Assume dataBinder starts with no disallowed fields;
		WebDataBinder dataBinder = new WebDataBinder(new Owner());
		controller.setAllowedFields(dataBinder);
	}

	@Test
	@DisplayName("Returns the owner when ownerId is provided and exists in the repository")
	void testFindOwnerWithValidId() {
		Owner testOwner = new Owner();
		;
		testOwner.setId(1);
		;
		testOwner.setFirstName("John");
		;
		testOwner.setLastName("Doe");
		;
		when(owners.findById(1)).thenReturn(Optional.of(testOwner));
		var result = controller.findOwner(1);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Throws IllegalArgumentException when ownerId is provided but owner is not found")
	void testFindOwnerWithInvalidId() {
		when(owners.findById(999)).thenReturn(Optional.empty());
		assertThrows(IllegalArgumentException.class, () -> {
			controller.findOwner(999);
		});
	}

}

